import React, { useState } from "react";

const Content = () => {
	const [items, setItems] = useState([
		{
			id: 1,
			checked: false,
			item: "Book",
		},
		{
			id: 2,
			checked: false,
			item: "Computer",
		},
		{
			id: 3,
			checked: false,
			item: "Calculator",
		},
	]);

	return (
		<div>
			<main>
				<ul>
					{items.map((item) => (
						<li className="item" key={item.id}>
							<input type="checkbox" checked={item.checked} />
							<label>{item.item}</label>
							<button>Delete</button>
						</li>
					))}
				</ul>
			</main>
		</div>
	);
};

export default Content;
